mv output/temp/agg_losses-quantile-0.95*.csv output/BC/ebR_BC5929_agg_losses-q95_r1.csv;
oq export src_loss_table -1 -e csv -d output/temp/
mv output/temp/src_loss_table_*.csv output/BC/ebR_BC5929_src_loss_table_r1.csv;
